/* eslint-disable jsx-a11y/anchor-is-valid */
import { createContext, FunctionComponent, useState } from "react";
import { Link } from "react-router-dom";
import About from "./about";
import BusinessSignUp from "./businessSignUp";
import SignIn from "./signIn";
import SignUp from "./signUp";


interface StartNavbarProps{

}
const themes = {
    light:{
      color: "black",
      background: "white"
    },
    dark:{
      color: "white",
      background: "black"
    }
}
export const SiteTheme = createContext(themes.light);

const StartNavbar: FunctionComponent<StartNavbarProps> = () => {
    const [darkMod,setDarkMod] = useState<boolean>(false)
    return <>
        <SiteTheme.Provider value={darkMod ? themes.dark : themes.light}>
            <About />
            <SignIn />
            <SignUp />
            <BusinessSignUp />
        </SiteTheme.Provider>
    <nav className="navbar navbar-dark navbar-expand-lg bg-dark">
        <div className="container-fluid ">
            <a  className="navbar-brand" href="#">Navbar
            <button onClick={() => setDarkMod(!darkMod)} className="btn btn-primary" id="themeBtn"><i className="fa-regular fa-sun"></i></button>
            </a>
            <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
            </button>
            <div className=" collapse navbar-collapse" id="navbarSupportedContent">
            <ul className=" navbar-nav m-auto mb-2 mb-lg-0">
                <li  className="nav-item">
                <Link to="/about" className="nav-link">About</Link>
                </li>
                <li className="nav-item">
                <Link to="/signin" className="nav-link">Sign in</Link>
                </li>
                <li className="nav-item">
                <Link to="/signup" className="nav-link">Sign up</Link>
                </li>
                <li className="nav-item">
                <Link to="/business-signup" className="nav-link">Business</Link>
                </li>
            </ul>
            </div>

        </div>
    </nav>
    </>
}

export default StartNavbar;
